// ─── Typing Animation Hook ───────────────────────────────
function useTypingAnimation(text, startTyping, dotDuration = 1800, wordsPerTick = 2, tickMs = 80) {
  const [phase, setPhase] = useState("waiting");
  const [dots, setDots] = useState("");
  const [visibleText, setVisibleText] = useState("");

  useEffect(() => {
    if (!startTyping) return;
    setPhase("dots");
    setDots(".");
    let dotCount = 1;
    const dotInterval = setInterval(() => {
      dotCount = (dotCount % 3) + 1;
      setDots(".".repeat(dotCount));
    }, 350);
    const dotTimer = setTimeout(() => {
      clearInterval(dotInterval);
      setPhase("typing");
    }, dotDuration);
    return () => { clearInterval(dotInterval); clearTimeout(dotTimer); };
  }, [startTyping, dotDuration]);

  useEffect(() => {
    if (phase !== "typing") return;
    const words = text.split(" ");
    let idx = 0;
    const interval = setInterval(() => {
      idx += wordsPerTick;
      if (idx >= words.length) {
        setVisibleText(text);
        setPhase("done");
        clearInterval(interval);
      } else {
        setVisibleText(words.slice(0, idx).join(" "));
      }
    }, tickMs);
    return () => clearInterval(interval);
  }, [phase, text, wordsPerTick, tickMs]);

  return { phase, dots, visibleText };
}

// ─── Dramatic Reveal Hook (for "Rules in favor of") ──────
function useRevealText(text, startReveal, delayMs = 800) {
  const [visible, setVisible] = useState(false);
  const [displayText, setDisplayText] = useState("");
  const [charIdx, setCharIdx] = useState(0);

  useEffect(() => {
    if (!startReveal) return;
    const t = setTimeout(() => setVisible(true), delayMs);
    return () => clearTimeout(t);
  }, [startReveal, delayMs]);

  useEffect(() => {
    if (!visible) return;
    if (charIdx >= text.length) return;
    const t = setTimeout(() => {
      setCharIdx(charIdx + 1);
      setDisplayText(text.slice(0, charIdx + 1));
    }, 60);
    return () => clearTimeout(t);
  }, [visible, charIdx, text]);

  return { visible, displayText, done: charIdx >= text.length };
}

