// ─── Chat Bubble with Typing + Dramatic Verdict ──────────

function ChatBubble({ name, title, avatar, pickSpecies, argument, fromRight, isFinal, startTyping }) {
  const { phase, dots, visibleText } = useTypingAnimation(argument, startTyping, 1800, 2, 80);
  const verdict = useRevealText(pickSpecies || "", phase === "done", 600);

  return (
    <div className={`chat-entry ${fromRight ? "from-right" : ""} ${isFinal ? "final-entry" : ""}`}>
      <div className="chat-avatar-col">
        <img src={avatar} alt={name} className="chat-avatar" />
        <div className="chat-avatar-name">{name}</div>
        <div className="chat-avatar-title">{title}</div>
      </div>
      <div className={`bubble ${isFinal ? "final-bubble" : ""}`}>
        {phase === "done" && pickSpecies && (
          <div className="bubble-pick">
            Rules in favor of: {verdict.done
              ? <span className="bubble-pick-name">{pickSpecies}</span>
              : <span className="bubble-pick-name">{verdict.displayText}<span style={{ opacity: 0.4 }}>|</span></span>
            }
          </div>
        )}
        {phase === "dots" && <div className="bubble-dots">{dots}</div>}
        {(phase === "typing" || phase === "done") && (
          <div className="bubble-text">
            {visibleText.split("\n\n").map((p, i) => <p key={i}>{p}</p>)}
            {phase === "typing" && <span style={{ opacity: 0.3 }}>|</span>}
          </div>
        )}
      </div>
    </div>
  );
}

function DeliberationModal({ judgment, m1, m2, onClose }) {
  const chatgptSpecies = judgment.chatgpt.pick === "m1" ? judgment.m1sub.species : judgment.m2sub.species;
  const geminiSpecies = judgment.gemini.pick === "m1" ? judgment.m1sub.species : judgment.m2sub.species;
  const courtSpecies = judgment.winner === "m1" ? judgment.m1sub.species : judgment.m2sub.species;

  const [stage, setStage] = useState(0);
  const chatgptTyping = useTypingAnimation(judgment.chatgpt.argument, stage >= 1, 1800, 2, 80);
  const geminiTyping = useTypingAnimation(judgment.gemini.argument, stage >= 2, 1800, 2, 80);
  const claudeTyping = useTypingAnimation(judgment.claude.ruling, stage >= 3, 2500, 2, 70);

  useEffect(() => { const t = setTimeout(() => setStage(1), 500); return () => clearTimeout(t); }, []);
  useEffect(() => { if (chatgptTyping.phase === "done" && stage === 1) { const t = setTimeout(() => setStage(2), 800); return () => clearTimeout(t); } }, [chatgptTyping.phase, stage]);
  useEffect(() => { if (geminiTyping.phase === "done" && stage === 2) { const t = setTimeout(() => setStage(3), 800); return () => clearTimeout(t); } }, [geminiTyping.phase, stage]);

  // Close on Escape
  useEffect(() => {
    const handler = (e) => { if (e.key === "Escape") onClose(); };
    window.addEventListener("keydown", handler);
    return () => window.removeEventListener("keydown", handler);
  }, [onClose]);

  return (
    <div className="modal-overlay" onClick={(e) => { if (e.target === e.currentTarget) onClose(); }}>
      <div className="modal-content">
        <button className="modal-close" onClick={onClose}>{"\u00D7"}</button>
        <div className="deliberation">
          <div className="deliberation-header">Bird Court Deliberations</div>

          {stage >= 1 && (
            <ChatBubble name="The Advocate" title="Counsel for the Principled" avatar={CHATGPT_AVATAR}
              pickSpecies={chatgptTyping.phase === "done" ? chatgptSpecies : null}
              argument={judgment.chatgpt.argument} fromRight={false} startTyping={stage >= 1} />
          )}
          {stage >= 2 && (
            <ChatBubble name="The Sophist" title="Counsel for the Absurd" avatar={GEMINI_AVATAR}
              pickSpecies={geminiTyping.phase === "done" ? geminiSpecies : null}
              argument={judgment.gemini.argument} fromRight={true} startTyping={stage >= 2} />
          )}
          {stage >= 3 && (
            <>
              <div className="ruling-divider" style={{ animationDelay: "0.1s" }}>{"\u2014"} FINAL RULING {"\u2014"}</div>
              <ChatBubble name="The Court" title="Presiding Judge" avatar={CLAUDE_AVATAR}
                pickSpecies={claudeTyping.phase === "done" ? courtSpecies : null}
                argument={judgment.claude.ruling} fromRight={false} isFinal={true} startTyping={stage >= 3} />
            </>
          )}
        </div>
      </div>
    </div>
  );
}

// ─── Matchup Detail Page ──────────────────────────────────

function MatchupDetailPage({ matchup, week, onBack }) {
  const m1 = getMember(matchup.m1);
  const m2 = getMember(matchup.m2);
  const completed = !!matchup.judgment;
  const weekData = SCHEDULE.find(s => s.week === week);
  const isActive = weekData?.status === "active";
  const hasJudgment = !!matchup.judgment;

  const [sub1Data, setSub1Data] = useState(matchup.sub1 || null);
  const [sub2Data, setSub2Data] = useState(matchup.sub2 || null);
  const [editing1, setEditing1] = useState(!matchup.sub1);
  const [editing2, setEditing2] = useState(!matchup.sub2);
  const [form1, setForm1] = useState({ species: "", desc: "" });
  const [form2, setForm2] = useState({ species: "", desc: "" });
  const [files1, setFiles1] = useState([]);
  const [files2, setFiles2] = useState([]);
  const [submitting, setSubmitting] = useState(false);
  const [showModal, setShowModal] = useState(false);
  const fileRef1 = useRef(null);
  const fileRef2 = useRef(null);

  const handleSubmit = async (side) => {
    const form = side === 1 ? form1 : form2;
    const files = side === 1 ? files1 : files2;
    const memberId = side === 1 ? matchup.m1 : matchup.m2;
    if (!form.species || !form.desc) return;

    setSubmitting(true);
    try {
      const formData = new FormData();
      formData.append("species", form.species);
      formData.append("description", form.desc);
      files.forEach(f => formData.append("media", f));

      const res = await fetch(API_URL + "/api/submit/" + week + "/" + memberId, {
        method: "POST",
        body: formData,
      });
      if (!res.ok) throw new Error("Submit failed");
      const result = await res.json();
      const subData = { species: form.species, desc: form.desc, media: result.mediaFiles || [] };
      if (side === 1) { setSub1Data(subData); setEditing1(false); setFiles1([]); }
      if (side === 2) { setSub2Data(subData); setEditing2(false); setFiles2([]); }
    } catch (err) {
      console.error("Submit error:", err);
      alert("Failed to submit. Please try again.");
    }
    setSubmitting(false);
  };
  const handleResubmit = (side) => {
    if (side === 1) { setForm1({ species: "", desc: "" }); setFiles1([]); setSub1Data(null); setEditing1(true); }
    if (side === 2) { setForm2({ species: "", desc: "" }); setFiles2([]); setSub2Data(null); setEditing2(true); }
  };
  const handleFiles = (side, newFiles) => {
    const arr = Array.from(newFiles);
    if (side === 1) setFiles1(prev => [...prev, ...arr]);
    else setFiles2(prev => [...prev, ...arr]);
  };
  const removeFile = (side, index) => {
    if (side === 1) setFiles1(prev => prev.filter((_, i) => i !== index));
    else setFiles2(prev => prev.filter((_, i) => i !== index));
  };

  const renderSubmitForm = (side, form, setForm) => {
    const files = side === 1 ? files1 : files2;
    const fileRef = side === 1 ? fileRef1 : fileRef2;
    return (
    <div className="battle-side">
      <div className="battle-name">{side === 1 ? m1.name : m2.name}</div>
      <div className="submit-form">
        <div className="form-group"><label>Bird Species:</label><input className="form-input" placeholder='e.g. "Pileated Woodpecker"' value={form.species} onChange={(e) => setForm({ ...form, species: e.target.value })} /></div>
        <div className="form-group"><label>Encounter:</label><textarea className="form-input" placeholder="Tell us about the encounter..." value={form.desc} onChange={(e) => setForm({ ...form, desc: e.target.value })} /></div>
        <div className="form-group">
          <label>Photos / Video / Audio:</label>
          <input type="file" ref={fileRef} multiple accept="image/*,video/*,audio/*" style={{ display: "none" }} onChange={(e) => handleFiles(side, e.target.files)} />
          <div className="upload-zone" onClick={() => fileRef.current?.click()}
            onDragOver={(e) => { e.preventDefault(); e.currentTarget.style.borderColor = "var(--ink)"; }}
            onDragLeave={(e) => { e.currentTarget.style.borderColor = "#ccc"; }}
            onDrop={(e) => { e.preventDefault(); e.currentTarget.style.borderColor = "#ccc"; handleFiles(side, e.dataTransfer.files); }}>
            Click to upload or drag files here<br /><span style={{ fontSize: 11, color: "var(--ink-light)" }}>JPG, PNG, MP4, MP3</span>
          </div>
          {files.length > 0 && (
            <div style={{ marginTop: 8 }}>
              {files.map((f, i) => (
                <div key={i} style={{ display: "flex", alignItems: "center", gap: 8, fontSize: 12, padding: "4px 0", borderBottom: "1px solid #eee" }}>
                  {f.type.startsWith("image/") && <img src={URL.createObjectURL(f)} alt="" style={{ width: 40, height: 40, objectFit: "cover", border: "1px solid #ccc" }} />}
                  {f.type.startsWith("video/") && <span style={{ fontSize: 18 }}>{"\uD83C\uDFA5"}</span>}
                  {f.type.startsWith("audio/") && <span style={{ fontSize: 18 }}>{"\uD83C\uDFB5"}</span>}
                  <span style={{ flex: 1, overflow: "hidden", textOverflow: "ellipsis", whiteSpace: "nowrap" }}>{f.name}</span>
                  <span style={{ color: "var(--ink-light)" }}>({(f.size / 1024).toFixed(0)}KB)</span>
                  <button onClick={() => removeFile(side, i)} style={{ background: "none", border: "none", cursor: "pointer", color: "#c00", fontWeight: "bold" }}>{"\u2715"}</button>
                </div>
              ))}
            </div>
          )}
        </div>
        <button className="submit-btn" onClick={() => handleSubmit(side)} disabled={submitting}>{submitting ? "Submitting..." : "Submit Your Bird"}</button>
      </div>
    </div>
  );};

  const renderSubmittedSide = (member, subData, side) => (
    <div className="battle-side submitted-side">
      <div className="battle-name">{member.name}<span className="submitted-tag">SUBMITTED</span></div>
      <div className="battle-species">{subData.species}</div>
      {getBirdPhoto(week, member.id) && <img src={getBirdPhoto(week, member.id)} alt={subData.species} className="battle-photo" />}
      {subData.media && subData.media.length > 0 && subData.media.map((url, i) => {
        const fullUrl = url.startsWith("http") ? url : API_URL + url;
        if (url.match(/\.(jpg|jpeg|png|gif|webp)$/i)) return <img key={i} src={fullUrl} alt="" className="battle-photo" />;
        if (url.match(/\.(mp4|mov|webm)$/i)) return <video key={i} src={fullUrl} controls className="battle-photo" />;
        return null;
      })}
      <div className="battle-desc">{subData.desc}</div>
      {isActive && <button className="resubmit-btn" onClick={() => handleResubmit(side)}>Resubmit</button>}
    </div>
  );

  if (hasJudgment) {
    const j = matchup.judgment;
    const winnerMember = j.winner === "m1" ? m1 : m2;
    const winnerSub = j.winner === "m1" ? j.m1sub : j.m2sub;
    return (
      <div className="section">
        <button className="back-btn" onClick={onBack}>{"\u2190"} Back</button>
        <h2 className="section-title">Week {week} - Bird Court</h2>
        <div className="detail-matchup-header">
          {m1.name} <span style={{ fontFamily: "'PixelatedElegance', monospace", fontSize: 14, opacity: 0.6, margin: "0 12px" }}>VS</span> {m2.name}
        </div>
        <div className="winner-banner">
          <div className="winner-banner-label">Winner</div>
          <div className="winner-banner-species">{winnerSub.species}</div>
          <div className="winner-banner-submitter">submitted by {winnerMember.name}</div>
          <div className="winner-banner-summary">{j.summary}</div>
        </div>
        <div className="battle-grid">
          <div className={`battle-side ${j.winner === "m1" ? "winner" : ""}`}>
            <div className="battle-name">{m1.name}{j.winner === "m1" && <span className="winner-tag">WINNER</span>}</div>
            <div className="battle-species">{j.m1sub.species}</div>
            {getBirdPhoto(week, matchup.m1) && <img src={getBirdPhoto(week, matchup.m1)} alt={j.m1sub.species} className="battle-photo" />}
            <div className="battle-desc">{j.m1sub.desc}</div>
          </div>
          <div className={`battle-side ${j.winner === "m2" ? "winner" : ""}`}>
            <div className="battle-name">{m2.name}{j.winner === "m2" && <span className="winner-tag">WINNER</span>}</div>
            <div className="battle-species">{j.m2sub.species}</div>
            {getBirdPhoto(week, matchup.m2) && <img src={getBirdPhoto(week, matchup.m2)} alt={j.m2sub.species} className="battle-photo" />}
            <div className="battle-desc">{j.m2sub.desc}</div>
          </div>
        </div>
        <button className="view-decision-btn" onClick={() => setShowModal(true)}>View Court Decision</button>
        {showModal && <DeliberationModal judgment={j} m1={m1} m2={m2} onClose={() => setShowModal(false)} />}
      </div>
    );
  }

  return (
    <div className="section">
      <button className="back-btn" onClick={onBack}>{"\u2190"} Back</button>
      <h2 className="section-title">Week {week} - Bird Court</h2>
      <div className="detail-matchup-header">
        {m1.name} <span style={{ fontFamily: "'PixelatedElegance', monospace", fontSize: 14, opacity: 0.6, margin: "0 12px" }}>VS</span> {m2.name}
      </div>
      <div className="battle-grid">
        {sub1Data && !editing1 ? renderSubmittedSide(m1, sub1Data, 1) : renderSubmitForm(1, form1, setForm1)}
        {sub2Data && !editing2 ? renderSubmittedSide(m2, sub2Data, 2) : renderSubmitForm(2, form2, setForm2)}
      </div>
    </div>
  );
}

function HomePage({ onMatchupSelect, activeWeek, setActiveWeek }) {
  const w = SCHEDULE.find((s) => s.week === activeWeek);
  return (
    <>
      <Hero />
      <div className="section">
        <h2 className="section-title">Bird Court</h2>
        <div className="week-selector">
          {SCHEDULE.map((s) => (
            <button key={s.week} className={`week-btn ${activeWeek === s.week ? "active" : ""}`} onClick={() => setActiveWeek(s.week)}>
              Week {s.week}{s.status === "completed" ? " \u2713" : s.status === "active" ? " \u25B6" : ""}
            </button>
          ))}
        </div>
        {w?.matchups.length > 0 ? w.matchups.map((mu, i) => (
          <MatchupCard key={i} mu={mu} weekStatus={w.status} onClick={() => onMatchupSelect(mu, w.week)} clickable />
        )) : (
          <div style={{ textAlign: "center", padding: "32px 0", color: "var(--ink-light)", fontSize: 14 }}>
            Matchups not yet announced
          </div>
        )}
      </div>
      <StandingsView />
    </>
  );
}

export default function App() {
  const [dataLoaded, setDataLoaded] = useState(false);
  const [apiError, setApiError] = useState(false);

  useEffect(() => {
    fetch(API_URL + "/api/data")
      .then(r => { if (!r.ok) throw new Error("API error"); return r.json(); })
      .then(data => {
        if (data.members) MEMBERS = data.members;
        if (data.standings) STANDINGS = data.standings;
        if (data.schedule) SCHEDULE = data.schedule;
        setDataLoaded(true);
      })
      .catch(err => {
        console.warn("API fetch failed, using embedded data:", err);
        setApiError(true);
        setDataLoaded(true);
      });
  }, []);


  const [tab, setTab] = useState("home");
  const [selectedMatchup, setSelectedMatchup] = useState(null);
  const [selectedWeek, setSelectedWeek] = useState(null);
  const [activeWeek, setActiveWeek] = useState(3);

  const handleMatchupSelect = (mu, week) => { setSelectedMatchup(mu); setSelectedWeek(week); setActiveWeek(week); setTab("matchup-detail"); };
  const handleBack = () => { setSelectedMatchup(null); setTab("home"); };

  return (
    <>
      <style>{css}</style>
      <div className="app">
        <Nav setTab={(t) => { setTab(t); setSelectedMatchup(null); }} />
        {tab === "home" && <HomePage onMatchupSelect={handleMatchupSelect} activeWeek={activeWeek} setActiveWeek={setActiveWeek} />}
        {tab === "matchup-detail" && selectedMatchup && (
          <MatchupDetailPage matchup={selectedMatchup} week={selectedWeek} onBack={handleBack} />
        )}
        <div className="footer">Bird League S1 — Judged by ChatGPT, Gemini, and Claude</div>
      </div>
    </>
  );
}
